script: |
  super -f text -I q10661.spq | sort > q10661.out

inputs:
  - name: q10661.spq
    data: |
      SELECT + col2 / + col0 AS col0 FROM tab0 (FORMAT parquet) WHERE ( - ( + - 4 ) ) NOT BETWEEN 38 AND col0 * + col1 + - col0 * col2 + 27;
  - name: tab0

outputs:
  - name: q10661.out
    data: |
      0
      1
      3
